function GetData() {
    const handleSubmit = (e) => {
        e.preventDefault();
    }

    return(
        <form onSubmit={handleSubmit} style={{display: 'block'}}>
            <label>Vorname: 
                <input type="text" placeholder="Vorname..." />
            </label><br />
            <label>Nachname: 
                <input type="text" placeholder="Nachname..." />
            </label>
        </form>
    )
}

export default GetData;
